// src/components/Testimonials/testimonialCard.styles.js

const styles = {
  card: {
    height: '100%',
    border: '2px solid #ccc',
    borderRadius: 2,
    boxShadow: 'none',
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'space-between',
    p: 1.5,
  },
  stars: {
    color: '#f5a623',
    fontSize: 18,
    letterSpacing: 1,
    mb: 1,
  },
  text: {
    mb: 2,
  },
};

export default styles;
